import React from 'react';

const DetailItem = (props) => {

    console.log("Detail Item: ", props);

    const { id, date, item, price, vendor } = props.order;

    return (
        <tr>
            <td>{id}</td>
            <td>{date}</td>
            <td>${price}</td>
            <td>{vendor}</td>
        </tr>
    );
};

export default DetailItem;
